<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>InvestorBeats â€” Chill lofi beats + live investing data</title>
  <meta name="theme-color" content="#000000" />
  <style>
    :root {
      --bg:#000000;
      --text:#eaeaea;
      --muted:#9aa0a6;
      --green:#16ff81;
      --red:#ff4058;
      --twitch:#9146FF;
    }
    * { box-sizing: border-box; }
    html, body { height: 100%; margin:0; padding:0; }
    body {
      font-family: ui-sans-serif, system-ui, -apple-system, Segoe UI, Roboto, Helvetica, Arial;
      color: var(--text);
      background: var(--bg);
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      min-height: 100vh;
      text-align: center;
      overflow: hidden;
    }
    .logo-img {
      width: clamp(200px, 30vw, 320px);
      height: auto;
      display: block;
      margin: 0 auto;
      border-radius: 12px;
      -webkit-mask-image: radial-gradient(closest-side, #fff 83%, rgba(255,255,255,0) 100%);
              mask-image: radial-gradient(closest-side, #fff 83%, rgba(255,255,255,0) 100%);
    }
    .eq {
      width: clamp(56px, 8vw, 72px);
      height: clamp(34px, 6vh, 44px);
      display: grid;
      grid-auto-flow: column;
      gap: 5px;
      align-items: end;
      margin-top: 8px;
    }
    .bar {
      width: 8px;
      border-radius: 6px;
      background: linear-gradient(180deg, var(--green), var(--red));
      box-shadow: 0 0 18px rgba(22,255,129,.35);
      transform-origin: bottom;
    }
    @keyframes bop { 0%{transform:scaleY(.35)} 50%{transform:scaleY(1)} 100%{transform:scaleY(.35)} }
    .bar:nth-child(1) { height:38%; animation:bop 1.4s ease-in-out .0s infinite; }
    .bar:nth-child(2) { height:60%; animation:bop 1.2s ease-in-out .05s infinite; }
    .bar:nth-child(3) { height:86%; animation:bop 1.15s ease-in-out .10s infinite; }
    .bar:nth-child(4) { height:56%; animation:bop 1.35s ease-in-out .15s infinite; }
    .bar:nth-child(5) { height:74%; animation:bop 1.1s ease-in-out .20s infinite; }
    .tagline {
      margin: 24px 0 0;
      color: var(--muted);
      font-size: clamp(16px, 2.2vw, 18px);
    }
    .buttons {
      display: flex;
      gap: 12px;
      flex-wrap: wrap;
      justify-content: center;
      margin-top: 14px;
    }
    .btn {
      display: inline-flex;
      align-items: center;
      gap: 10px;
      padding: 12px 16px;
      border-radius: 14px;
      font-weight: 800;
      letter-spacing: .3px;
      text-decoration: none;
      transition: transform .15s ease, box-shadow .15s ease, filter .15s ease, background .15s ease;
      box-shadow: 0 0 0 1px rgba(255,255,255,.08), 0 10px 26px rgba(0,0,0,.35);
      color: #fff;
    }
    .btn.twitch { background: var(--twitch); }
    .btn.twitch:hover { transform: translateY(-1px); filter: drop-shadow(0 0 10px rgba(22,255,129,.55)); }
    .btn.instagram { background: linear-gradient(135deg, #F58529, #DD2A7B 35%, #8134AF 68%, #515BD4); }
    .btn.instagram:hover { transform: translateY(-1px); filter: drop-shadow(0 0 10px rgba(22,255,129,.55)); }
    .btn svg { width: 18px; height: 18px; fill: currentColor; }
    .btn .label { position: relative; top: 1px; }
    footer { margin-top: 16px; color: var(--muted); font-size: 12px; opacity: .85; }
  </style>
</head>
